&quot;Nover 16th 1874: Fine day sun shineing made an ox yoke for Murphy in four noon left the Shanty about One O'Clock in Company with Murphy Crossed the woods to Wlshes Shanty distance about four miles took Gun along shot two Partridges on the way over Murphy went home again that night.&quot;

&quot;17th: Rained all day verry Dark &amp; Heavy fog. Staid at Welshes until one O'Clock. left there and walked to Genarouxs distance about seven miles. Took Gun along shot three Partridges on the way down &amp; wounded two. Staid over night at Genarouxs.&quot;

&quot;Nover 18th: Sun bright in morning about then O'Clock a.m. Small flakes of snow fell got little cloudy at noon sun bright and turned cold in after noon. left Genarouxs Shanty and walked to Welshes distance 7 miles staid there over night.&quot;

&quot;19th: Fine morning left Welshes shanty about noon went to Murphy's to meet Butter &amp; Job Lingham. Welsh went with me across the woods shot one Partridge on the way over. Left Murphys about 2p.m. with Butter, Mruphy &amp; Welsh went to Pages Depot shot two Partridges on the way over Cloudy evening snow falling walked 7 miles this day.&quot;

Part of Denis Nealon's diary.
